<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "DTD/xhtml1-strict.dtd">
<html xmlns="http://www.w3.org/1999/xhtml">
<head>
    <meta http-equiv="Content-Type" content="text/html; charset=ISO-8859-1"/>
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8"/>
    <title>Website Sketch.ep</title>
    <LINK rel="stylesheet" type="text/css" href="Resources/Style.css">
    </LINK></head>
<body>
<div id="leftpanel">
    <div class="ThumbContainer">
        <a href="#price_home_page" title="Go to page 'Price Home'">
            <img src="pages/price_home.png"/>
            <hr/>
            <span class="number">1/5</span> -
            Price Home
        </a>
    </div>
    <div class="ThumbContainer">
        <a href="#current1_page" title="Go to page 'Current1'">
            <img src="pages/current1.png"/>
            <hr/>
            <span class="number">2/5</span> -
            Current1
        </a>
    </div>
    <div class="ThumbContainer">
        <a href="#historical1_page" title="Go to page 'Historical1'">
            <img src="pages/historical1.png"/>
            <hr/>
            <span class="number">3/5</span> -
            Historical1
        </a>
    </div>
    <div class="ThumbContainer">
        <a href="#historicalcharts_page" title="Go to page 'HistoricalCharts'">
            <img src="pages/historicalcharts.png"/>
            <hr/>
            <span class="number">4/5</span> -
            HistoricalCharts
        </a>
    </div>
    <div class="ThumbContainer">
        <a href="#historicaltables_page" title="Go to page 'HistoricalTables'">
            <img src="pages/historicaltables.png"/>
            <hr/>
            <span class="number">5/5</span> -
            HistoricalTables
        </a>
    </div>
</div>
<div id="main">
    <div class="Page" id="price_home_page">
        <div class="pageTitle">Price Home
            <div class="MainNumber">
                Page 1/5
            </div>
        </div>
        <div class="ImageContainer"><img class="raster" style="max-width:470px" src="pages/price_home.png"
                                         usemap="#map_price_home"/></div>
        <map name="map_price_home">
            <area shape="rect" coords="257,132,394,165" href="#historical1_page" title="Go to page 'Historical1'"/>
            <area shape="rect" coords="56,132,193,165" href="#current1_page" title="Go to page 'Current1'"/>
        </map>
    </div>
    <div class="Page" id="current1_page">
        <div class="pageTitle">Current1
            <div class="MainNumber">
                Page 2/5
            </div>
        </div>
        <div class="ImageContainer"><img class="raster" style="max-width:899px" src="pages/current1.png"
                                         usemap="#map_current1"/></div>
        <map name="map_current1"></map>
    </div>
    <div class="Page" id="historical1_page">
        <div class="pageTitle">Historical1
            <div class="MainNumber">
                Page 3/5
            </div>
        </div>
        <div class="ImageContainer"><img class="raster" style="max-width:398.41796875px" src="pages/historical1.png"
                                         usemap="#map_historical1"/></div>
        <map name="map_historical1">
            <area shape="rect" coords="166,220,258,247" href="#historicalcharts_page"
                  title="Go to page 'HistoricalCharts'"/>
        </map>
    </div>
    <div class="Page" id="historicalcharts_page">
        <div class="pageTitle">HistoricalCharts
            <div class="MainNumber">
                Page 4/5
            </div>
        </div>
        <div class="ImageContainer"><img class="raster" style="max-width:752px" src="pages/historicalcharts.png"
                                         usemap="#map_historicalcharts"/></div>
        <map name="map_historicalcharts">
            <area shape="rect" coords="15,178,736.63330078125,954.7333374023438" href="#historicaltables_page"
                  title="Go to page 'HistoricalTables'"/>
        </map>
    </div>
    <div class="Page" id="historicaltables_page">
        <div class="pageTitle">HistoricalTables
            <div class="MainNumber">
                Page 5/5
            </div>
        </div>
        <div class="ImageContainer"><img class="raster" style="max-width:813.625px" src="pages/historicaltables.png"
                                         usemap="#map_historicaltables"/></div>
        <map name="map_historicaltables">
            <area shape="rect" coords="15,178,798.63330078125,551.7333374023438" href="#historicalcharts_page"
                  title="Go to page 'HistoricalCharts'"/>
        </map>
    </div>
</div>
</body>
</html>
